import * as React from 'react';
import './App.css';
import { TextField } from '@mui/material';

function App() {
  const [email, setEmail] = React.useState('');
  const [password, setPassword] = React.useState('');

  const changeUsername = (event) => {
    setEmail(event.target.value);
  }
  const changePassword = (event) => {
    setPassword(event.target.value);
  }
  const submit = () => {
    if (email == '') {
      // error
    }
    if (password == '') {
      // error
    }
    console.log(email, password);
    // post to DB
  }
  return (
    <div id="App">
      <div style={{width: '460px', margin: '0 auto'}}>
        <div id="login-section" style={{
          margin: '120px auto 0px',
          border: '1px solid #eaeced',
          borderRadius: '12px',
          overflow: 'hidden',
          padding: '30px 10% 50px',
          }}>
          <header style={{margin: '0 auto 13.116%', display: 'flex',
          justifyContent: 'center'}}>
            <p style={{background: 'transparent url(https://www.paypalobjects.com/paypal-ui/logos/svg/paypal-mark-color.svg) top center no-repeat',
            width: '34px', height: '40px', margin: '0px'}}></p>
          </header>
          <div id="login-form" style={{padding: 'auto'}} >
            <TextField
              id="username"
              label="Email address or mobile number"
              variant="filled"
              fullWidth
              value={email}
              onChange={changeUsername}
              InputProps={{disableUnderline: true}}
              sx={{
                '& label': {
                  color: '#6c7378',
                  fontSize: '18px',
                  py: '3px',
                },
                '& label.Mui-focused': {
                  color: '#6c7378'
                },
                '& .MuiFilledInput-root': {
                  overflow: 'hidden',
                  border: 1,
                  borderRadius: '4px',
                  marginBottom: '16px',
                  borderColor: '#9da3a6',
                  backgroundColor: 'transparent',
                  fontWeight: 500,
                  fontSize: '1.1rem',
                  py: '4px',
                  '&:hover': {
                    borderColor: '#2140C1'
                  },
                  '&.Mui-focused': {
                    border: 3,
                    borderColor: '#2140C1',
                    boxShadow: '0px 0px 0px 6px #DFEAFC'
                  }
                }
              }}
            />
            <TextField
              id="password"
              label="Password"
              variant="filled"
              type="password"
              value={password}
              onChange={changePassword}
              fullWidth
              InputProps={{disableUnderline: true}}
              sx={{
                '& label': {
                  color: '#6c7378',
                  fontSize: '18px',
                  py: '3px',
                },
                '& label.Mui-focused': {
                  color: '#6c7378'
                },
                '& .MuiFilledInput-root': {
                  overflow: 'hidden',
                  border: 1,
                  borderRadius: '4px',
                  marginBottom: '16px',
                  borderColor: '#9da3a6',
                  backgroundColor: 'transparent',
                  fontWeight: 500,
                  fontSize: '1.1rem',
                  py: '4px',
                  '&:hover': {
                    borderColor: '#2140C1'
                  },
                  '&.Mui-focused': {
                    border: 3,
                    borderColor: '#2140C1',
                    boxShadow: '0px 0px 0px 6px #DFEAFC'
                  }
                }
              }}
            />
            <div id="forgot-password">
              <a id="forgot-password-link" href="https://www.paypal.com/authflow/password-recovery/">Forgotten password?</a>
            </div>
            <button id="button-login" type="submit" onClick={submit}>
              Log In
            </button>
            <div id="separator" style={{
              borderTop: '1px solid #cbd2d6',
              marginTop: '8.72%',
              marginBottom: '4.895%',
              height: '15px',
              textAlign: 'center',
              fontSize: '83.34%',
            }}>
              <span style={{
                backgroundColor: '#fff',
                padding: '0 0.5em',
                color: '#6c7378',
                top: '-0.7em',
                position: 'relative'
              }}>or</span>
            </div>
            <button id="button-sign-up" onClick={() => {window.location.href='https://www.paypal.com/au/webapps/mpp/account-selection'}}>Sign Up</button>
          </div>
          <div style={{
              position: 'relative',
              display: 'block',
              fontSize: '12px',
              marginTop: '72px',
          }}>
          </div>
        </div>
      </div>
      <footer style={{paddingTop: '14px', bottom: 0, position: 'relative'}}>
          <div className="legalFooter" style={{textAlign: 'center', padding: '14px', backgroundColor: '#F7F9FA'}}>
            <ul className="footerGroup" style={{listStyleType: 'none', textAlign: 'center', margin: 0, padding: 0}}>
              <li><a target="_blank" href="https://www.paypal.com/au/smarthelp/contact-us" pa-marked="1">Contact Us</a></li>
              <li><a target="_blank" href="https://www.paypal.com/au/webapps/mpp/ua/privacy-full" pa-marked="1">Privacy</a></li>
              <li><a target="_blank" href="https://www.paypal.com/au/webapps/mpp/ua/legalhub-full" pa-marked="1">Legal</a></li>
              <li><a target="_blank" href="https://www.paypal.com/au/webapps/mpp/country-worldwide" pa-marked="1">Worldwide</a></li>
            </ul>
          </div>
        </footer>
    </div>
  );
}

export default App;
